import React, { Component, useEffect, useState, FlatList} from 'react';
import { StyleSheet, Text, View, TextInput} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import CardPlato from '../Components/CardPlato';
import Item from "../Components/ListaPlatos"
import { GetPlatos } from '../Axios/AxiosClient';

const DetallePlato =({navigation})=>{
    const [Detalle, setDetalle] = useState([]);

  return (
    
    <View>
        <TextInput   
                style={styles.input}
                placeholder="Ingrese plato"

                onChangeText={text => {
                  if(text.length > 2){
                     GetPlatos(text).then((data) => {
                      setPlatos(data)
                  })

                  .catch(() => {
                    console.log("Datos mal")   
                });
                  }
                }}
            />
            <CardPlato Detalle={Item}></CardPlato>
   
    </View>
    
  );
}
export default DetallePlato

const styles = StyleSheet.create({
   
        
  });
